import React, { Component } from 'react'
import Head from './Head'
import Login from './Login'
import MassageAdmin from '../Components/MassageAdmin'
import { CookiesProvider, withCookies } from 'react-cookie'
import { connect } from 'react-redux'
class Monitor extends Component {
    constructor() {
        super()
        this.state = {
            page: <html>aaa</html>
        }
    }

   componentDidMount() {
        let loginStat = this.props.login.map(a => a.typeLogin).toString()
        if (loginStat === "false") {
            this.setState({
                page: <div><Login /></div>
            })
        }
    }
    componentWillReceiveProps(){
        let loginStat = this.props.login.map(a => a.typeLogin).toString()
        if (loginStat === "false") {
            this.setState({
                page: <div><Login /></div>
            })
        }
    }
    render() {
        return (
            <div>
                <CookiesProvider>
                    <Head />
                    {this.state.page}
                </CookiesProvider>
            </div>
        )
    }
}
const loginStat = state => {
    return {
        login: state.loginStat
    }
}
export default connect(loginStat)(withCookies(Monitor))
